] 找到一个你喜欢的,我建议你尽快完成这个任务.

- 除了分段模式, 你的HUD还具有一个对接模式, 按下在屏幕的左下角的阶段对接按钮. 这样做是从旋转控制改变为平移控制, 让您的 W, A, S, D键控制平移和左Shift键和左侧Control控制向上向下,有点像控制Kerbal EVA。

- 使用对接模式并不是必需的. 无论哪种模式最适合你. 但请记住, 分段模式中你也可以使用 I, K, J, L, H和N像在对接模式中那样控制飞船, 你可以任何时间在暂停菜单中检查键绑定.

 Shader "Sprite/Vertex Colored" { 
Properties { 
_Color ("Main Color", Color) = (0.5,0.5,0.5,1) 
_MainTex ("Base (RGB) Trans (A)", 2D) = "white" {} 
} 
Category { 
Tags {"Queue"="Transparent" "IgnoreProjector"="True" "RenderType"="Transparent"} 
ZWrite Off 
Blend SrcAlpha OneMinusSrcAlpha  
SubShader { 
	Material { 
		Diffuse [_Color] 
	} 
	Pass { 
		ColorMaterial AmbientAndDiffuse 
		Lighting Off 
		Cull Off 
   SetTexture [_MainTex] { 
      Combine texture * primary, texture * primary 
 } 
SetTexture [_MainTex] { 
    constantColor [_Color] 
    Combine previous * constant DOUBLE, previous * constant 
}   
} 
}  
} 
}
